import React from 'react';
import { Link } from 'react-router-dom';
import logo from './logo.svg';
function Header() {
  return (
    <div class="decoration-clone bg-gradient-to-b from-yellow-400 to-red-500 text-transparent">
      <header>
        <Link to="/">
          <img src={logo} alt="Tractian logo" />
        </Link>
      </header>
      <span class="decoration-clone bg-gradient-to-b from-yellow-400 to-red-500 text-transparent">
        Hello
        World
      </span>
    </div>
  );
}

export default Header;
